import React from 'react';
import './App.css';
import NavBar from './components/navBar/navBar';
import Slideshow from './components/slide/slideShow';
import "react-slideshow-image/dist/styles.css";
import Card  from './components/card/card';
function App() {
  return (
    <div>
     <NavBar/>
     <Slideshow />
     <Card />
    </div>
  );
}

export default App;
